import React, { useState } from 'react';
import { ArrowLeft, Share2 } from 'lucide-react';

const SimplifiedEmbeddedSystemsPage = () => {
  const [currentModule, setCurrentModule] = useState(5);
  const [currentSubchapter, setCurrentSubchapter] = useState("5.4");
  const [expandedModules, setExpandedModules] = useState([5]);
  
  // Course data based on content.md
  const courseName = "Introduction to Embedded Systems";
  const modules = [
    {
      id: 1,
      title: "What are Embedded Systems?",
      duration: "1 hour",
      completed: true
    },
    {
      id: 2,
      title: "Design Challenges in Embedded Systems",
      duration: "1 hour",
      completed: true
    },
    {
      id: 3,
      title: "Embedded Processor Technology",
      duration: "1 hour",
      completed: true
    },
    {
      id: 4,
      title: "Hardware Design Fundamentals",
      duration: "1 hour",
      completed: true
    },
    {
      id: 5,
      title: "Microcontroller Architectures",
      duration: "1 hour",
      completed: false,
      expanded: true,
      submodules: [
        { id: "5.1", title: "8051 Architecture", completed: false },
        { id: "5.2", title: "PIC Architecture", completed: false },
        { id: "5.3", title: "ARM Architecture", completed: false },
        { id: "5.4", title: "Comparison of the Three Architectures", completed: false }
      ]
    }
  ];

  // Toggle module expansion
  const toggleModule = (moduleId) => {
    if (expandedModules.includes(moduleId)) {
      setExpandedModules(expandedModules.filter(id => id !== moduleId));
    } else {
      setExpandedModules([...expandedModules, moduleId]);
    }
  };

  // Learning objectives content
  const learningObjectives = "In this chapter, students will gain insights into three widely used microcontroller architectures: 8051, PIC, and ARM. By the end of this section, students will be equipped to compare their features and capabilities, serving as a foundation for more detailed exploration in subsequent modules. This chapter builds on Chapters 3 and 4 by providing concrete examples of microcontroller architectures and explaining their practical applications and performance metrics.";

  return (
    <div style={{ fontFamily: 'Arial, sans-serif', maxWidth: '1200px', margin: '0 auto' }}>
      {/* Back and home navigation */}
      <div style={{ 
        padding: '12px 20px', 
        borderBottom: '1px solid #e5e7eb',
        display: 'flex',
        alignItems: 'center'
      }}>
        <button style={{
          display: 'flex',
          alignItems: 'center',
          background: 'none',
          border: 'none',
          cursor: 'pointer',
          color: '#4f46e5',
          padding: '0'
        }}>
          <ArrowLeft size={16} style={{ marginRight: '4px' }} />
          <span style={{ 
            display: 'inline-flex',
            alignItems: 'center',
            justifyContent: 'center',
            width: '18px',
            height: '18px',
            border: '1px solid currentColor',
            borderRadius: '3px'
          }}>⌂</span>
        </button>
      </div>
      
      {/* Main Content */}
      <div style={{ padding: '0 20px' }}>
        <h1 style={{ fontSize: '24px', fontWeight: 'bold', marginTop: '16px', marginBottom: '16px' }}>
          {courseName}
        </h1>
        
        {/* Sharing and Bloom's level */}
        <div style={{ marginBottom: '16px', display: 'flex', flexDirection: 'column', gap: '8px' }}>
          <div style={{ display: 'flex', gap: '8px' }}>
            <button style={{
              display: 'flex',
              alignItems: 'center',
              padding: '4px 8px',
              border: '1px solid #d1d5db',
              borderRadius: '4px',
              background: 'white',
              cursor: 'pointer',
              fontSize: '14px'
            }}>
              <Share2 size={14} style={{ marginRight: '4px' }} />
              Share
            </button>
            <button style={{
              padding: '4px 8px',
              border: '1px solid #d1d5db',
              borderRadius: '4px',
              background: 'white',
              cursor: 'pointer',
              fontSize: '14px'
            }}>
              ⋮
            </button>
          </div>
          
          <div>
            <div style={{ fontSize: '14px', marginBottom: '4px' }}>
              Bloom's Taxonomy Level: Evaluate
            </div>
            <div style={{ fontSize: '14px', marginBottom: '4px' }}>
              5/6
            </div>
            <button style={{
              padding: '4px 8px',
              fontSize: '12px',
              border: '1px solid #d1d5db',
              borderRadius: '4px',
              background: 'white',
              cursor: 'pointer'
            }}>
              Evaluate Again
            </button>
          </div>
        </div>
        
        <h2 style={{ 
          fontSize: '18px', 
          fontWeight: 'bold',
          marginTop: '32px',
          marginBottom: '12px'
        }}>
          Course content
        </h2>
        
        <div style={{ fontSize: '14px', marginBottom: '16px' }}>
          18 / 22 sections completed
        </div>
        
        {/* Module list */}
        <div style={{ marginBottom: '32px' }}>
          {modules.map(module => (
            <div key={module.id}>
              <div style={{ 
                padding: '12px',
                border: '1px solid #e5e7eb', 
                marginBottom: '1px',
                backgroundColor: module.id === 5 ? '#f5f7fa' : 'white',
                display: 'flex',
                alignItems: 'center'
              }}>
                <input 
                  type="checkbox" 
                  checked={module.completed}
                  readOnly
                  style={{ marginRight: '8px' }}
                />
                <div style={{ flex: 1 }}>
                  <div style={{ fontSize: '14px' }}>
                    {module.title}
                  </div>
                  <div style={{ fontSize: '12px', marginTop: '4px' }}>
                    {module.duration} {module.id === 5 ? '△' : '▽'}
                  </div>
                </div>
              </div>
              
              {module.id === 5 && (
                <div>
                  {module.submodules?.map(submodule => (
                    <div 
                      key={submodule.id}
                      style={{
                        padding: '8px 12px 8px 32px',
                        border: '1px solid #e5e7eb',
                        marginBottom: '1px',
                        backgroundColor: currentSubchapter === submodule.id ? '#f0f9ff' : '#f9fafb',
                        display: 'flex',
                        alignItems: 'center'
                      }}
                    >
                      <input 
                        type="radio"
                        checked={currentSubchapter === submodule.id}
                        readOnly
                        style={{ marginRight: '8px' }}
                      />
                      <div style={{ fontSize: '14px' }}>
                        {submodule.id} {submodule.title}
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          ))}
        </div>
        
        {/* Chapter Content */}
        <div>
          <h2 style={{ 
            fontSize: '24px', 
            fontWeight: 'bold',
            marginBottom: '24px'
          }}>
            Chapter 5: Microcontroller Architectures (8051, PIC, ARM)
          </h2>
          
          <h3 style={{ 
            fontSize: '20px', 
            fontWeight: 'bold',
            marginBottom: '16px',
            marginTop: '32px'
          }}>
            Learning Objectives
          </h3>
          
          <p style={{ lineHeight: '1.5', marginBottom: '24px' }}>
            {learningObjectives}
          </p>
        </div>
      </div>
    </div>
  );
};

export default SimplifiedEmbeddedSystemsPage;
